import React from 'react'
import pic from './productivity.png';

export default function TopBar() {
    return (
        <div>
            <div style={{backgroundColor: 'black'}}>
            <img src={pic} style={{opacity: '40%', width: '100%'}} alt="this is image" />
            </div>
        </div>
    )
}
